In order to define our vertex type, we need to create a struct that will implement the Vertex trait. That trait requires various information to be provided by the implementor. You don’t have to worry about those, because a crate exists to automatically implement such a trait: luminance-derive . First thing first: add luminance-derive to your project’s [dependencies] section: luminance-derive = "0.7" Simple. One last thing: when you will use the Vertex derive annotation, you will have to provide a vertex semantics type, implementing the Semantics trait. Again, you don’t have to implement such a trait by hand: luminance-derive will handle all that for you. Vertex semantics are a way to tell luminance what the relationship between all objects you intend to create and the way they will be rendered is. In our case, we just only need two semantics: vertex positions and vertex colors . Let’s create our semantics type by using a proc-macro derive from luminance-derive : use luminance_derive::Semantics; Our proc-macro derive, yay. Let’s use it: #[derive(Copy, Clone, Debug, Semantics)]
pub enum VertexSemantics { #[sem(name = "position", repr = "[f32; 2]", wrapper = "VertexPosition")] Position, #[sem(name = "color", repr = "[u8; 3]", wrapper = "VertexRGB")] Color,
} Woah, that’s a lot of new syntax! Indeed, let’s dig the syntax: The Semantics derive annotation marks an enum as being representative of vertex semantics . Currently, nothing else than enum is supported. The type implementing Semantics must also implement Copy , Clone and Debug . Each variant of the enum represents a distinct vertex semantics . The syntax #[sem(..)] provides several mandatory information: The name = "position" annotation gives luminance a way to recognize the semantics in shader stages . You don’t have to worry about what it means so far but keep in mind that that identifier must be unique. repr = "[f32; 2]" tells which is the underlying expected type of the semantics. That constructs a strongly-typed assumption about the semantics. A "position" is a 2D f32. Period. You have a large list of types you can use here but you are limited to the implementors of VertexAttrib . The wrapper = "VertexPosition" annotation generates a new type called VertexPosition and in scope in the module you declared the enum. That type is one of the only ones which are recognized as being usable with the Semantics enum you just declared — it implements the HasSemantics trait for which HasSemantics::Sem = VertexSemantics. This type is also equipped with some functions and implementors, such as new, From / Into, etc. All of this might be a bit confusing; let’s clarify even further. When you declare an enum annotated with #[derive(Copy, Clone, Debug, Semantics)], luminance-derive does automatically implement Semantics for you and generates as many types as variants in your enum. Those types represent vertex attributes types you will be able to use to construct types that will correctly implement the Vertex trait. Talking about Vertex , let’s go and define our vertex type. The Vertex derive annotation works on both structs and tuple-struct. Import the Vertex proc-macro derive first: use luminance_derive::{Semantics, Vertex}; And then define your Vertex type (it’s possible to use the same typename because proc-macro won’t clash with types): #[derive(Clone, Copy, Debug, Vertex)]
#[vertex(sem = "VertexSemantics")]
pub struct Vertex { #[allow(dead_code)] position: VertexPosition, #[allow(dead_code)] #[vertex(normalized = "true")] color: VertexRGB,
} A new syntax! So: The Vertex derive annotation marks a struct as being a valid vertex type. Currently, only struct with fields and tuple-struct are supported. The #[vertex(sem = "VertexSemantics")] provides a mapping to a type that represents your vertex semantics . Each field must have a type that implements HasSemantics<Sem = VertexSemantics> in that case. Don’t forget about the wrapper types that got generated with the Semantics derive: those types are valid as fields’ types here. The special #[vertex(normalized = "true")] annotation marks a field as being normalized . Normalized fields make sense when the field is of an integral type, such as [u8; 3], which is unsigned integral . When trying to fetch normalized vertex attributes, a vertex stage will get normalized floating point numbers (lying in [0.; 1.]) instead of the typical e.g. [0; 255]. And we are good to go as our vertex type is now live! Some notes: the generated wrapper types have some useful methods and implementors. You can easily get a list by running cargo doc --open.

