A fragment shader runs for every rasterized fragments from the render of your Tess . Basically, your GPU transforms the geometry, projects it, performs several complex operations we end up with rasterized data. Rasterized data means to discretize all the vertex attributes. The discretization process is based on the resolution of the render target — i.e. the frame buffer outputs. Rasterized data will perform, for instance, interpolation of your vertex attributes so that each texel (i.e. a frame buffer / texture pixel ) has its version of the vertex attribute. A rasterized triangle can be imagined as a collection of thousands of texels representing a triangle. Each and everyone of them will store a color, in our case, so that it’s easy to render that on a screen, store in an image, etc. In your project, add the src/fs.glsl file with the following content: // this was the vertex shader output; it’s now our (rasterized and interpolated) input!
