use try_guard::verify;
use wavefront_obj::obj; // … #[derive(Debug)]
struct Obj { vertices: Vec<Vertex>, indices: Vec<VertexIndex>,
} impl Obj { fn to_tess<C>(self, ctxt: &mut C) -> Result<Tess<Vertex, VertexIndex, (), Interleaved>, TessError> where C: GraphicsContext<Backend = Backend>, { ctxt .new_tess() .set_mode(Mode::Triangle) .set_vertices(self.vertices) .set_indices(self.indices) .build() } fn load<P>(path: P) -> Result<Self, String> where P: AsRef<Path>, { let file_content = { let mut file = File::open(path).map_err(|e| format!("cannot open file: {}", e))?; let mut content = String::new(); file.read_to_string(&mut content).unwrap(); content }; let obj_set = obj::parse(file_content).map_err(|e| format!("cannot parse: {:?}", e))?; let objects = obj_set.objects; verify!(objects.len() == 1).ok_or("expecting a single object".to_owned())?; let object = objects.into_iter().next().unwrap(); verify!(object.geometry.len() == 1).ok_or("expecting a single geometry".to_owned())?; let geometry = object.geometry.into_iter().next().unwrap(); println!("loading {}", object.name); println!("{} vertices", object.vertices.len()); println!("{} shapes", geometry.shapes.len()); // build up vertices; for this to work, we remove duplicated vertices by putting them in a // map associating the vertex with its ID let mut vertex_cache: HashMap<obj::VTNIndex, VertexIndex> = HashMap::new(); let mut vertices: Vec<Vertex> = Vec::new(); let mut indices: Vec<VertexIndex> = Vec::new(); for shape in geometry.shapes { if let obj::Primitive::Triangle(a, b, c) = shape.primitive { for key in &[a, b, c] { if let Some(vertex_index) = vertex_cache.get(key) { indices.push(*vertex_index); } else { let p = object.vertices[key.0]; let position = VertexPosition::new([p.x as f32, p.y as f32, p.z as f32]); let vertex = Vertex { position }; let vertex_index = vertices.len() as VertexIndex; vertex_cache.insert(*key, vertex_index); vertices.push(vertex); indices.push(vertex_index); } } } else { return Err("unsupported non-triangle shape".to_owned()); } } Ok(Obj { vertices, indices }) }
} Basically, calling Obj::load(path) here will get us a Result<Obj, String>. We can then just convert it to a Tess for luminance to process.

