in vec2 position;
in vec3 color; // this is the output of the vertex shader (we could have had several ones)
out vec3 v_color; void main() { // simply forward the color v_color = color; // mandatory; tell the GPU to use the position vertex attribute to put the vertex in space gl_Position = vec4(position, 0., 1.);
} In our case, we don’t have vertex colors anymore and we will likely just set a constant color to start with. Plus, now the point is in 3D, not 2D. in vec3 position; // 3D point! void main() { gl_Position = vec4(position, 1.);
} The problem is: it’s easy for the GPU to render 2D coordinates because there’s nothing to project: your screen is already using a 2D space coordinate system. However, how should we handle our 3D vertices? You already have the answer: the projection matrix. That matrix will just turn your 3D vertices into 2D vertices. In order to use it, you need to declare a shader uniform variable . Uniforms are special variables which values are set by the application before or after a render command. When a render command is issued, it is not possible to change the value anymore until the render command has finished. You can picture those uniform values as constants over a draw call . Some graphics APIs call those constant buffers for that reason. Let’s add one we’ll call projection. You declare them at global scope, just next to in and out declarations. They can be declared in any shader stage that needs to manipulate them. uniform mat4 projection; It’s as simple as that. In our case, projection is a 4×4 matrix that will be supplied by the application. In order to be projected, a point must be multiplied by a matrix. Let’s just project our 3D point then: gl_Position = projection * vec4(position, 1.); All of this might be a bit weird or awkward at first because it’s highly linked to how vector spaces and linear algebra work but you’ll have to trust me on this (or read some linear algebra theory!). Now let’s add the view matrix, allowing us to slightly offset the camera in the scene: uniform mat4 view; Simple, right? gl_Position = projection * view * vec4(position, 1.); So, some explications here. We multiply view and position first because view is a matrix that transforms a 3D point into another 3D point. You can picture that as a basis transformation . Then we want to project that transformed point, so we multiply by the projection at the very left. That’s all for the GLSL code. Nothing else to do: our 3D point is now projected onto our screen by having gone through two basis change: A 3D -> 3D linear transformation to move the camera around . A 3D -> 2D projection to introduce perspective.

