In order for your application to actually update and send those matrices to the GPU, you need to declare them and change the way the shader Program works. A special concept must be used here: uniform interfaces . A uniform interface is a typed contract between the GLSL code compiled and linked in a shader Program and what you are supposed to do with it. This powerful abstraction allows you to specify, via a type, a set of variables that are available in the GLSL code and that you can get access to as soon as your Program gets shading things. The way you do this is a multi-step yet simple process: You define a struct that holds the GPU variables. Those are called Uniform . You implement the UniformInterface trait for that type. If you don’t want to get too much into the details of that trait, you can use luminance-derive to implement the trait very easily. That’s what we are going to do. You set your Program type variable setting its uniform interface to the type you just created. When you use a ShadingGate to shade objects, you have access to your uniform interface and can then update GPU variables there. Why cannot you create and handle the uniform interface by yourself? The thing is: that concept must be contravariant , because allowing you to handle such objects around while they depend on the current GPU context and state would be highly unsafe. Let’s create such a type. #[derive(Debug, UniformInterface)]
struct ShaderInterface { #[uniform(unbound)] projection: Uniform<[[f32; 4]; 4]>, #[uniform(unbound)] view: Uniform<[[f32; 4]; 4]>,
} Sooo… as you can see, we define a regular struct but derive UniformInterface . Deriving the trait unlocks several annotations you can use via the #[uniform(..)] syntax. Here, we’ll talk about two: #[uniform(unbound)]: that annotation tells luminance that if the GPU variable this uniform variable refers to is inactive or inexistent , no error will be generated. Instead, a special unbound uniform variable will be emitted. So an unbound Uniform<[[f32; 4]; 4]> means that if the GPU variable named after that uniform is inactive or inexistent , the resulting Uniform<[[f32; 4]; 4]> will silently do nothing when you will try to update it. This is a feature you want when you’re developing or debugging but you should disable that on an end-user application or if you don’t care about errors for a given variable. #[uniform(name = "foo")]: rename the field. By default, the GLSL uniform variable will match the name of the struct field you define. You can change the mapping with that simple annotation. You can of course mix annotations; e.g. #[uniform(name = "t", unbound)] is an unbound uniform variable mapped to a uniform float t in the GLSL code. All we have to do now is to change the type of our Program to use the uniform interface and we’re done. let program = ctxt .new_shader_program::<VertexSemantics, (), ShaderInterface>() .from_strings(VS_STR, None, None, FS_STR) .unwrap() .ignore_warnings();

