} else { return Err("unsupported non-triangle shape".to_owned()); } } Ok(Obj { vertices, indices }) }
} fn main() { let dim = WindowDim::Windowed { width: 960, height: 540, }; let surface = GlfwSurface::new_gl33("Hello, world!", WindowOpt::default().set_dim(dim)); match surface { Ok(surface) => { eprintln!("graphics surface created"); main_loop(surface); } Err(e) => { eprintln!("cannot create graphics surface:\n{}", e); exit(1); } }
