We’re getting to the interesting things. Before trying to render cool rotating cubes, we need to understand how graphics rendering works in luminance . luminance has a special way of encoding renders. Instead of giving you all the GPU power right away, it constrains you to pretty much none. That seems insane but you will eventually recognize that such a way of doing is actually pretty useful. What it means is that by default, you cannot do anything and you are required to build up types to unlock new GPU features. To render something, you need several resources. The first resource is a frame buffer . A frame buffer, encoded with Framebuffer , is a special GPU resource that holds frames , i.e. the pixel storage for renders! So… is the back buffer you told us earlier some kind of Framebuffer ? It’s not some kind: it is a Framebuffer . And guess what: you can access it via the ctxt.back_buffer() method. So, let’s make our first cool render and make a color-varying background! First, you will need to import one symbol from luminance : GraphicsContext , which is a trait that allows you to run luminance code and talk to the GPU. We will also use Instant , from the standard library, to handle low-precision yet sufficient time points. Add PipelineState to support graphics pipelines: more on that later in this chapter. use luminance::context::GraphicsContext as _;
use luminance::pipeline::PipelineState;
use std::time::Instant; We don’t need, so far, to have access to the GraphicsContext symbol — we just need the implementors. Now, let’s get our back buffer. fn main_loop(mut surface: GlfwSurface) { let start_t = Instant::now(); let mut ctxt = surface.context; let events = surface.events_rx; let back_buffer = ctxt.back_buffer().expect("back buffer"); 'app: loop { // … As you can see, getting the back buffer is piece of cake. Now let’s handle that color. // rendering code goes here // get the current time and create a color based on the time let t = start_t.elapsed().as_secs_f32(); let color = [t.cos(), t.sin(), 0.5, 1.]; let render = ctxt .new_pipeline_gate() .pipeline( &back_buffer, &PipelineState::default().set_clear_color(color), |_, _| Ok(()), ) .assume(); // swap buffer chains if render.is_ok() { ctxt.window.swap_buffers(); } else { break 'app; } That’s already a lot of code to discuss. ctxt.new_pipeline_gate() gets a lightweight object that you can use to create graphics pipelines — its type is PipelineGate . You can get that type once and for all and keep it around if you want to but in our case, since we’re only going to create a single pipeline, we’ll just chain everything. Then, the PipelineGate::pipeline function, applied to the PipelineGate object, creates a graphics pipeline. A graphics pipeline is just a strongly typed description of what a GPU should do in order to render things into a Framebuffer . You can picture pipelines as AST s in which each node represents a given resource sharing and leaves are actual renders. In our case, we don’t want to render anything, we just want to modify the back buffer background color. That is done with the arguments you pass to PipelineGate::pipeline . The first one is the frame buffer to render to. In our case, it’s our back buffer. The second argument is the pipeline state ( PipelineState to use when running our pipeline. Everytime you perform a render into a frame buffer, you need to provide such an object, which contains the color to use when clearing the framebuffer’s color buffers. It is possible to tell luminance not to clear color buffers but this is off topic. The third and last argument is a closure you need to pass. That closure will be called as soon as the frame buffer is ready to receive a render. All this code is fully synchronous though, so lifetimes are enforced. In our case, since we’re not interested into making any actual render, we just pass a closure that does nothing – it simply returns Ok(()). More on its two arguments later. The assume() method, defined on Render , is an identity function (i.e. it simply forwards its argument). It doesn’t seem very useful, but there’s a small trick: it explicitely states that its argument has a type which error types are PipelineError . It’s indeed possible to use a different error type in the graphics pipeline, but in our case, we will just use the default one and assume the pipeline is typed with it. It gives hint to the type system to use this error type and remove any ambiguity, then. You should obtain a window with a varying color, such as the following screenshot. The complete code is: use glfw::{Action, Context as _, Key, WindowEvent};
